import React, { Component } from 'react';
import Stomp from 'webstomp-client';

import './user.css';

class UserDevices extends Component {
  constructor(props) {
    super(props);
    this.state = {
      devices: [],
      loggedInUsername: '',
    };
    this.stompClient = null;
    this.userId = null;
  }

  componentDidMount() {
    this.getLoggedInUsername();
  }
  componentWillUnmount() {
    if (this.stompClient !== null) {
      this.stompClient.disconnect();
    }
  }

  getLoggedInUsername = () => {
    fetch('http://localhost:8080/auth/username', {
      method: 'GET',
      headers: {
        'Authorization': 'Bearer ' + localStorage.getItem('token'),
      },
    })
        .then((response) => response.text())
        .then((username) => {
          console.info("Logged-in Username:" + username);
          this.setState({ loggedInUsername: username }, () => {
            this.getUserIdFromUsername();
            this.getDevices();
          });
        })
        .catch((error) => {
          console.error('Error fetching logged-in username:', error);
        });
  };

  getUserIdFromUsername = () => {
    fetch(`http://localhost:8080/user/id?username=${this.state.loggedInUsername}`, {
      method: 'GET',
      headers: {
        'Authorization': 'Bearer ' + localStorage.getItem('token'),
      },
    })
        .then((response) => response.json())
        .then((data) => {
          this.userId = data;
          console.log("id:" + this.userId);
          this.initializeWebSocket();
        })
        .catch((error) => {
          console.error('Error fetching userId:', error);
        });
  };

  initializeWebSocket = () => {
    this.socket = new WebSocket(`localhost:8281/websocket`);
    this.stompClient = Stomp.over(this.socket);

    this.stompClient.connect({}, () => {
      this.stompClient.subscribe(`/user/${this.userId}/notification`, (message) => {
        const notification = JSON.parse(message.body);
        console.info("aici am ajusn ar fi wow")
        this.displayNotification(notification);
      });
    }, (error) => {
      console.error('Error in connecting to WebSocket:', error.body);
    });
  };

  displayNotification = (notification) => {
    const popupNotification = document.createElement('div');
    popupNotification.className = 'popup-notification';
    popupNotification.innerHTML = `<p>${notification}</p>`;
    document.body.appendChild(popupNotification);

    setTimeout(() => {
      document.body.removeChild(popupNotification);
    }, 7000);
  };

  getDevices = () => {
    fetch('http://localhost:8081/user/devices', {
      method: 'GET',
      headers: {
        'Authorization': localStorage.getItem('token'),
      },
    })
        .then((response) => response.json())
        .then((data) => {
          this.setState({ devices: data });
        })
        .catch((error) => {
          console.error('Error fetching user devices:', error);
        });
  };

  render() {
    return (
        <div className="user-devices-container">
          <h2>User Devices</h2>
          <div className="table-container">
            <table className="user-devices-table">
              <thead>
              <tr>
                <th>Device ID</th>
                <th>Name</th>
                <th>Description</th>
                <th>Address</th>
                <th>Maximum Energy Consumption</th>
              </tr>
              </thead>
              <tbody>
              {this.state.devices.map((device) => (
                  <tr key={device.id}>
                    <td>{device.id}</td>
                    <td>{device.name}</td>
                    <td>{device.description}</td>
                    <td>{device.address}</td>
                    <td>{device.maximumEnergyConsumption}</td>
                  </tr>
              ))}
              </tbody>
            </table>
          </div>
        </div>
    );
  }
}

export default UserDevices;
